export default async function handler(
  req: NextApiRequest,
  res: NextApiResponse
) {
  if (req.method !== 'POST') {
    return res.status(405).json({ message: 'Method Not Allowed' })
  }

  Font.register({
    family: 'Gerstner',
    src: `data:font/ttf;base64,${fontString}`,
    fontStyle: 'normal',
    fontWeight: 'normal',
  })

  const styles = StyleSheet.create({
    body: {
      backgroundColor: '#ffffff',
      flexDirection: 'row',
      width: '100vw',
      height: '100vh',
      padding: '30px',
      position: 'relative',
    },
    leftColumn: {
      width: '35%',
      flexDirection: 'column',
      justifyContent: 'space-between',
      alignItems: 'flex-start',
      paddingRight: '36px',
    },
    rightColumn: {
      width: '65%',
      flexDirection: 'column',
      justifyContent: 'space-between',
      gap: '4px',
    },
    details: {
      flexDirection: 'column',
      gap: '16px',
      alignItems: 'flex-start',
    },
    label: {
      fontSize: 7,
      lineHeight: 1.1,
      textTransform: 'uppercase',
      paddingBottom: '2px',
      fontFamily: 'Gerstner',
      letterSpacing: '0.5px',
    },
    value: {
      fontSize: 9,
      lineHeight: 1.1,
      fontFamily: 'Gerstner',
    },
    imageContainer: {
      flex: '1',
      width: '100%',
      overflow: 'hidden',
      position: 'relative',
    },
    image: {
      width: '100%',
      height: '100%',
      objectFit: 'cover',
      objectPosition: 'center',
    },
    pageNumber: {
      position: 'absolute',
      right: 30,
      bottom: 12,
      zIndex: 100,
      width: 200,
      textAlign: 'right',
    },
    pageNumberText: {
      textTransform: 'uppercase',
      fontSize: 5,
      fontFamily: 'Gerstner',
      color: 'rgba(0, 0, 0, 0.5)',
      letterSpacing: '0.4px',
    },
  })

  const LabeledList = ({
    label,
    values,
  }: {
    label: string
    values: string[]
  }) => {
    if (!values || values.length === 0) return null
    return (
      <View>
        <Text style={styles.label}>{label}</Text>
        {values.map((item, index) => (
          <Text key={index} style={styles.value}>
            {item}
          </Text>
        ))}
      </View>
    )
  }

  const getUniqueItems = (items): string[] => {
    if (!items) return []
    return (
      Array.from(new Set(items?.flatMap((item) => item?.items || []))) || []
    )
  }

  const ClientToolsPDF = ({ projects }) => {
    return (
      <Document>
        {projects?.map((project, index) => {
          return (
            <Page key={index} size="LETTER">
              <View style={styles.body}>
                <View style={styles.pageNumber}>
                  <Text style={styles.pageNumberText}>
                    Page {index + 1} / {projects?.length ?? 0}
                  </Text>
                </View>
                <View style={styles.leftColumn}>
                  <Logo />
                  <View style={styles.details}>
                    <LabeledList label="Project" values={[project.title]} />
                    <LabeledList label="Client" values={project.client} />
                    <LabeledList label="Year" values={[project.year]} />
                    <LabeledList
                      label="Material"
                      values={getUniqueItems(project?.taggedMaterials)}
                    />
                    <LabeledList
                      label="Technique"
                      values={getUniqueItems(project?.taggedTechniques)}
                    />
                  </View>
                </View>
                <View style={styles.rightColumn}>
                  {project.media?.map((image, index) => {
                    return (
                      <View
                        style={styles.imageContainer}
                        key={`image-${index}`}
                      >
                        <Image src={image.url} style={styles.image} />
                      </View>
                    )
                  })}
                  {/* If the number of images is less than 3, fill the rest with blank images */}
                  {project.media?.length < 3 &&
                    Array.from({ length: 3 - project.media?.length }).map(
                      (_, index) => (
                        <View
                          style={styles.imageContainer}
                          key={`image-fill-${index}`}
                        ></View>
                      )
                    )}
                </View>
              </View>
            </Page>
          )
        })}
      </Document>
    )
  }

  try {
    const { projects, filename } = req.body

    if (!projects || !Array.isArray(projects) || !filename) {
      return res.status(400).json({ message: 'Invalid request body' })
    }

    const pdfBuffer = await renderToBuffer(
      <ClientToolsPDF projects={projects} />
    )

    res.setHeader('Content-Type', 'application/pdf')
    res.setHeader('Content-Disposition', `attachment; filename="${filename}"`)
    res.setHeader('Content-Length', pdfBuffer.length)

    res.send(pdfBuffer)
  } catch (error) {
    console.error('PDF generation error:', error)
    res.status(500).json({ message: 'Error generating PDF' })
  }
}
